import styled from 'styled-components';

export const Wrapper = styled.div`
  display: flex;

  overflow-x: scroll;
  width: 100%;
  height: 100%;
  margin-bottom: 8px;

  user-select: none;
`;

export const ContentWrapper = styled.div`
  position: relative;
  display: flex;
  gap: 34px;
`;
